import React from "react";
///import vaidhya_header_img from "..images/vaidhya_header_img.jpg"
import vaidhyalogo from "../images/vaidhya_header_img.jpg"
import "./Homepage.css"
function Header(){
    return(
        <nav className="Headers">
              <img
                src={vaidhyalogo}
                />
                <ul >
                    <li>About</li>
                    <li>ContactUs</li>
                    <li>Services</li>
                    <li>Login</li>

                </ul>
            </nav>
    )
}
export default Header
